tables.table_schema:
CREATE TABLE SwimmerFeedback (
    SwimmerID INT,
    CoachID INT,
    Feedback TEXT
);

CREATE TABLE Coaches (
    id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    experience_years INT,
    specialization VARCHAR(100)
);

CREATE TABLE Judges (
    id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    affiliation VARCHAR(100),
    overall_evaluation TEXT
);

CREATE TABLE Swimmers (
    swimmer_id SERIAL PRIMARY KEY,
    swimmer_name VARCHAR(50) NOT NULL,
    swimmer_age INT NOT NULL,
    swimmer_gender VARCHAR(10) NOT NULL
);

CREATE TABLE Coaches (
    coach_id SERIAL PRIMARY KEY,
    coach_name VARCHAR(50) NOT NULL,
    coach_specialty VARCHAR(50) NOT NULL
);

CREATE TABLE Judges (
    judge_id SERIAL PRIMARY KEY,
    judge_name VARCHAR(50) NOT NULL,
    judge_expertise VARCHAR(50) NOT NULL
);
